<template>
  <div class="bill">
    <!-- 票据 -->
    <el-button class="show1" id="goback" @click="goback">返回</el-button>
    <el-button class="show2" type="success" plain @click="dayin()"><i class="el-icon-printer"></i> 打印</el-button>
    <div class="bill_box" id="billregion">
      <img
        src="data:image/jpeg;base64,"
        alt
      />
      <div class="number">1000元</div>
    </div>
  </div>
</template>
<script>
export default {
  data() {
    return {
      targetData: {},
      id: ""
    };
  },
  methods: {
    getData() {},
    goback() {
      this.$router.push("/index/ticketlist");
    },
    dayin() {
        var show1 = document.getElementsByClassName('show1')[0]
        var classVal1 = show1.getAttribute('class')
        var show2 = document.getElementsByClassName('show2')[0]
        var classVal2 = show2.getAttribute('class')
        // 添加class 将按钮隐藏
        classVal1 = classVal1.concat(' mnone1')
        classVal2 = classVal2.concat(' mnone2')
        show1.setAttribute('class', classVal1)
        show2.setAttribute('class', classVal2)
        // return
        window.print() // 浏览器打印接口
        // 删除class 将按钮重新显示出来
        classVal1 = classVal1.replace(' mnone1', '')
        classVal2 = classVal2.replace(' mnone2', '')
        show1.setAttribute('class', classVal1)
        show2.setAttribute('class', classVal2)
    }
  }
}
</script>
